  const place = () => {
    tableTop.placeRobot()
    console.log(tableTop.grid);
    setGrid(tableTop.grid)
  }
  return (
    <div className="Controls">
      <span></span>
      <button>up</button>
      <span></span>
      <button>left</button>
      <button onClick={place}>place</button>
      <button>right</button>
      <span></span>
      <button>down</button>
      <span></span>
    </div>
  )
}
